.portal-common-title {
  width: 100%;
  height: 100%;
  font-size: 16px;
  padding: 0 15px;
  display: flex;
  align-items: center;
  justify-content: space-between;
  overflow: hidden;
  .title {
    flex: 1;
    display: flex;
    align-items: center;
    overflow: hidden;
    i {
      font-size: 18px;
    }
    span {
      padding-left: 5px;
      overflow: hidden;
      white-space: nowrap;
      text-overflow: ellipsis;
    }
  }
  .button {
    padding-left: 10px;
    max-width: 100px;
    overflow: hidden;
    text-overflow: ellipsis;
    white-space: nowrap;
  }
}
